import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="bg-emerald-300 h-screen w-screen">
      <div className="bg-emerald-600 rounded-lg w-1/2 m-auto h-4/5">
        <p className="text-center">Pierre est gay</p>
      </div>
    </div>
  );
}

export default App;
